    "A report on the trace element concentrations in sediments, vegetation, and fishes
    from the Lake Thompson Wetland Complex, South Dakota",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2014-04-24T15:02:50.107227",nt"name": "a-report-on-the-trace-element-concentrations-in-sediments-vegetation-and-fishes-from-the-l",nt"isopen":
    false,nt"url": null,nt"notes": "The results of this study identify the
    contaminants present, if any, and their concentrations in fish, cattail roots, and
    sediments from areas of concern in the Lake Thompson wetland complex. No organic
    compounds were present in the samples analyzed at concentrations expected to be
    toxic to waterfowl, their habitats, or their foods. Mercury was detected at above
    background concentrations in northern pike. Therefore, it is recommended that additional
    samples be collected from Lake Thompson in the future and analyzed for Hg to determine
    if it is having an impact on fish important in the diet of water birds or waterfowl
    production. The Lake Thompson complex receives drainage from a large watershed composed
    of agricultural fields. Surrounding croplands are treated with herbicides and insecticides
    that have the potential to wash into local wetlands. Future studies should determine
    the presence and environmental effects of pesticides on these wetlands.",nt"license_title":
